--
-- Name: get_slow_queries(); Type: FUNCTION; Schema: public; Owner: yare
--

CREATE FUNCTION public.get_slow_queries() RETURNS TABLE(query_text text, calls bigint, total_time double precision, mean_time double precision, rows bigint)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        query,
        calls,
        total_exec_time,
        mean_exec_time,
        rows
    FROM pg_stat_statements
    WHERE mean_exec_time > 1000  -- Queries taking more than 1 second
    ORDER BY mean_exec_time DESC
    LIMIT 20;
END;
$$;


