--
-- Name: transaction_stats; Type: VIEW; Schema: public; Owner: yare
--

CREATE VIEW public.transaction_stats AS
 SELECT date_trunc('hour'::text, transactions.created_at) AS hour,
    count(*) AS total_transactions,
    count(*) FILTER (WHERE ((transactions.status)::text = 'confirmed'::text)) AS confirmed_transactions,
    count(*) FILTER (WHERE ((transactions.status)::text = 'pending'::text)) AS pending_transactions,
    sum(transactions.amount) FILTER (WHERE ((transactions.status)::text = 'confirmed'::text)) AS total_volume,
    avg(transactions.amount) FILTER (WHERE ((transactions.status)::text = 'confirmed'::text)) AS avg_transaction_size
   FROM public.transactions
  WHERE (transactions.created_at > (now() - '24:00:00'::interval))
  GROUP BY (date_trunc('hour'::text, transactions.created_at))
  ORDER BY (date_trunc('hour'::text, transactions.created_at)) DESC;


